import Login from "./Authentication/Login";
import Register from "./Authentication/Register";
import Homepage from "./Views/Homepage";
import SearchPlayer from "./Views/SearchPlayer";
var routes = [
  {
    path: "/login",
    name: "Login",
    icon: "ni ni-key-25 text-info",
    component: Login,
    layout: "/auth",
    visible: false,
    children: [],
  },
  {
    path: "/register",
    name: "Register",
    icon: "ni ni-circle-08",
    component: Register,
    layout: "/auth",
    visible: false,
    children: [],
  },
  {
    path: "/homepage",
    name: "Homepage",
    icon: "ni ni-key-25 text-info",
    component: Homepage,
    layout: "/admin",
    visible: true,
    children: [],
  },
  {
    path: "/searchplayer",
    name: "Search Player",
    icon: "ni ni-key-25 text-info",
    component: SearchPlayer,
    layout: "/admin",
    visible: true,
    children: [],
  },
];
export default routes;
